sympy.sympy.polys.domains.domain.__call_:
def __call__(self, *args) -> Er:
    """Construct an element of ``self`` domain from ``args``. """
    return self.new(*args)

sympy.sympy.polys.domains.field.exquo:
def exquo(self, a: Ef, b: Ef) -> Ef:
    """Exact quotient of ``a`` and ``b``, implies ``__truediv__``.  """
    return a / b

def exquo(self, a, b):
    """Exact quotient of ``a`` and ``b``, implies ``__truediv__``.  """
    return MPQ(a) / MPQ(b)

sympy.sympy.polys.domains.ring.exquo:
def exquo(self, a, b):
    """Exact quotient of ``a`` and ``b``, implies ``__floordiv__``.  """
    if a % b:
        raise ExactQuotientFailed(a, b, self)
    else:
        return a // b
